import React from 'react';
import './Oilmanagement.css';

const Oilmanagement = () => {
  return (
    <div className="container">
      <Sidebar />
      <div className="main-content">
        <h1>Oil Management</h1>
        <div className="operations-history">
          <h2>Operations History</h2>

          <Operation
            date="25/1/2024 10:30:00 am"
            type="Tanker Fill"
            tanker="1"
            truck="-"
            quantity="40,000"
            location="Refinery A"
            status="completed"
          />
          <Operation
            date="25/1/2024 2:15:00 pm"
            type="Truck Fill"
            tanker="1"
            truck="1"
            quantity="25,000"
            location="Mumbai Terminal"
            status="completed"
          />
          <Operation
            date="25/1/2024 4:45:00 pm"
            type="Truck Fill"
            tanker="2"
            truck="3"
            quantity="28,000"
            location="Bangalore Hub"
            status="pending"
          />
        </div>
      </div>
    </div>
  );
};

const Sidebar = () => {
  const items = [
    'Dashboard',
    'Fleet Management',
    'Oil Management',
    'City Operations',
    'User Management',
    'Analytics',
    'Settings',
    'Logout',
  ];

  return (
    <div className="sidebar">
      {items.map((item, index) => (
        <div
          key={index}
          className={`sidebar-item ${item === 'Oil Management' ? 'active' : ''}`}
        >
          {item}
        </div>
      ))}
    </div>
  );
};

const Operation = ({ date, type, tanker, truck, quantity, location, status }) => (
  <div className="operation">
    <div className="operation-details">
      <span>Date & Time: {date}</span>
      <span>Type: {type}</span>
      <span>Tanker: {tanker}</span>
      <span>Truck: {truck}</span>
      <span>Quantity (L): {quantity}</span>
      <span>Location: {location}</span>
      <span>Status: {status}</span>
    </div>
  </div>
);

export default Oilmanagement;
